) ездит по столице и портит патриотические граффити. То замажет, то какой зелёной дряни подрисует.

По-хорошему, Юлии бы не мешало бахнуть штрафака за порчу фасадов. Но что-то нам подсказывает, что от правосудия она уйдёт. А вот от народной любви — уже едва ли.

PS. В сюжете Юлия говорит, что из-за своей ябатьковской активности рассталась с молодым человеком. Но, молодые люди приходят и уходят, а
